import { useSelector } from "react-redux";
import ReactTable from "react-table";

const TableData = () => {
  const { tableData } = useSelector((state) => state.dashData);
  return (
    <div>
      <table>
        <tr>
          <th>Firstname</th>
          <th>Lastname</th>
        </tr>
        {}
        <tr>
          <td>Peter</td>
          <td>Griffin</td>
          <td>$100</td>
        </tr>
        <tr>
          <td>Lois</td>
          <td>Griffin</td>
          <td>$150</td>
        </tr>
        <tr>
          <td>Joe</td>
          <td>Swanson</td>
          <td>$300</td>
        </tr>
      </table>
    </div>
  );
};
export default TableData;
